import React from 'react';

const mainDiv={
    height: '90vh',
    backgroundColor: '#cfcfcf',
}

const mainTitle={
    fontSize: '3vw',
    fontFamily: 'Roboto Mono',
    fontWeight: 400,
}

const subHeading={
    fontSize: '2vw',
    fontFamily: 'Roboto Mono',
    fontWeight: 100,
    color: '#9e9e9e'
}

class LandingPage extends React.Component{
    render(){
        return(
            <div style={mainDiv}>
                <div style={mainTitle}>
                    Hi, I'm Paridhi!
                </div>
                <div style={subHeading}>
                    I develop websites and mobile apps. I also design! 
                </div>
            </div>
        );
    }
}

export default LandingPage;
